class App extends Component {
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Switch>
            <Route exact path="/" component={Login} />
         <Route path="/register" component={Register} />
            <Route path="/forgetpassword" component={ForgetPassword} />
            <Route path="/resetpassword" component={ResetPassword} />
          </Switch>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
